import React from 'react';
import './Cards.css';
import Box from '@mui/material/Box';



function Cards() {
  return (
    <div className='cards'>
        <div className='container'>
        <h1> Nuestro Plan Maestro</h1>
            <div className='container-image'>
                    <Box
                    sx={{
                    boxShadow: 3,
                    width: '8rem',
                    height: '5rem',
                    bgcolor: (theme) => (theme.palette.mode === 'dark' ? '#101010' : '#fff'),
                    color: (theme) =>
                        theme.palette.mode === 'dark' ? 'grey.300' : 'grey.800',
                    p: 1,
                    m: 1,
                    borderRadius: 2,
                    textAlign: 'center',
                    fontSize: '0.875rem',
                    fontWeight: '700',
                    }}
                >
                    boxShadow: 3
                </Box>
                <img className='imagen' src='./images/PlanMaestro.png' />
            </div>
        </div>
    </div>
  );
}

export default Cards;
